import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';

class Header extends Component {
  render() {
    const pages = [
      'Home',
      'About',
      'Music',
      'Visual',
      'Web'
    ]

    return (
      <div className="Header">
        {pages.map(this.renderNavlink)}
      </div>
    );
  }

  ///////////////

  renderNavlink = (page) => {
    const link = {
      width: '100px',
      padding: '12px',
      margin: '0 6px 6px',
      background: 'blue',
      textDecoration: 'none',
      color: 'white',
    }
    const active = {
      width: '100px',
      padding: '12px',
      margin: '0 6px 6px',
      background: 'white',
      textDecoration: 'none',
      color: 'red',
    }

    return (
      <NavLink
        to={`/${page.toLowercase()}`}
        exact
        style={link}
        activeStyle={active}
      >
        {page}
      </NavLink>
    )
  }
}

export default Header;
